\r\n Pre flattens properties:
PRETENS PRATENS在汇总子句中引用的属性，以避免通过EF产生嵌套查询。
对于诸如groupby（（a），汇总的查询（b/c as max as as asilias1，b/d at max as as as as as as as as as as as as ailias2）））我们需要生成
。选择（
    $ it => new FlattennInWrapper（）{
        source = $ it，//将在Groupby阶段使用
        容器= new {
            值= $ it.b.c
            next = new {
                值= $ it.b.d
            }
        }
    }
）
此外，我们还需要在总阶段填充表达式以访问B/C和B/D。看起来像：
b/c：$ it.container.value
b/d：$ it.container.next.value

\r\n Check if the parameter i:
检查是否仅引用一次参数，并将其引用为“读取”。
确定应由参数代替的参数的特殊情况，而不是生成声明
为了它。
例子：
前：
无效呼叫者（bool x）
{
    Callee（foo（），bar（））
}
void callee（int a，int b）
{
    dosomething（a，b）;
}
后：
无效呼叫者（bool x）
{
    dosomething（foo（），bar（））;
}
void callee（int a，int b）
{
    dosomething（a，b）;
}
参数'a'和'b'仅在callee中使用一次，而其值则不使用。
对于这种情况，只需使用参数替换参数即可。
注意：这可能会导致语义变化。在上一个示例中，如果是
无效呼叫者（bool x）
{
    Callee（foo（），bar（））
}
void callee（int a，int b）
{
    dosomething（b，a）;
}
然后，此操作将改变评估顺序，但可以接受重构

