\r\n Indicate should inline e:
表明应将内联表达和可变声明合并为一条线。
例子：
前：
void caller（）
{
    callee（out var x）;
}
void callee（out int i）=> i = 100;
后：
（正确版本）
void caller（）
{
    int x = 100;
}
void callee（out int i）=> i = 100;
（错误版本）
void caller（）
{
    int x;
    x = 100;
}
void callee（out int i）=> i = 100;

